  false,\n\t\"url\": null,\n\t\"notes\": \"LIDAR-derived binary (.las) files containing
  points classified as bare-earth and canopy (first return) were produced for the
  2007 Northwest Florida Water Management District - Gadsden County, Florida lidar
  mapping project. The files were provided in a scheme of FDEM-derived 5,000 x 5,000
  foot (1500 x 1500 meter) tiles. Horizontal mapping units are in UTM meters, vertical
  mapping units are in U.S. survey feet. The total mapping area covers 535 square
  miles of Gadsden County, Florida.\",\n\t\"license_title\": null,\n\t\"extras\":
